import React from "react";
import { Link } from "react-router-dom";

import searchIcon from "../assets/icon/searchIcon.png";

const mainNav = [
  {
    display: "Trang chủ",
    path: "/",
  },
  {
    display: "Tớ là",
    path: "/about",
  },
  {
    display: "Chủ đề",
    path: "/accessories",
  },
  {
    display: "Liên hệ",
    path: "/contact",
  },
];

function Header() {
  return (
    <div className="header">
      <div className="container">
        <div className="header__logo">Huong Le Blog</div>
        <div className="header__menu">
          <div className="header__menu__left">
            <div className="header__menu__left__item header__menu__item">
              <Link to="/"> TRANG CHỦ </Link>
            </div>
            <div className="header__menu__left__item header__menu__item">
              <Link to="/about"> TỚ LÀ? </Link>
            </div>
            <div className="header__menu__left__item header__menu__item">
              <Link to="/title"> CHỦ ĐỀ </Link>
            </div>
          </div>
          <div className="header__menu__right">
            <div className="header__menu__right__item header__menu__item">
              <img src={searchIcon} alt="" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Header;
